                'Consideraciones' => '<p class="MsoNormalCxSpFirst" style="text-align: justify; line-height: 95%;"><strong style="mso-bidi-font-weight: normal;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',sans-serif;">CONSIDERANDO I: </span></strong></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 95%;"><strong style="mso-bidi-font-weight: normal;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',sans-serif;">&nbsp;</span></strong></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 95%;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',sans-serif;">Que, la Constituci&oacute;n Pol&iacute;tica del Estado promulgada el 07 de febrero de 2009, establece que Bolivia se constituye en un Estado Unitario Social de Derecho Plurinacional Comunitario, libre, independiente, soberano, democr&aacute;tico, intercultural, descentralizado y con autonom&iacute;as.</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 95%;"><strong style="mso-bidi-font-weight: normal;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',sans-serif;">&nbsp;</span></strong></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 95%; tab-stops: 531.6pt;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">Que, de conformidad a lo establecido por el art&iacute;culo 232 de la Constituci&oacute;n Pol&iacute;tica del Estado, &ldquo;La administraci&oacute;n p&uacute;blica se rige por los principios de legitimidad, legalidad, imparcialidad, publicidad, compromiso e inter&eacute;s social, &eacute;tica, transparencia, igualdad, competencia, eficiencia, calidad, calidez, honestidad, responsabilidad y resultados&rdquo;.</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 95%; tab-stops: 531.6pt;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">&nbsp;</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 95%; punctuation-wrap: simple; mso-line-break-override: restrictions; vertical-align: baseline;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">Que, el art&iacute;culo 272 de la CPE, se&ntilde;ala que: &ldquo;La autonom&iacute;a implica la elecci&oacute;n directa de sus autoridades por las ciudadanas y ciudadanos, la administraci&oacute;n de sus recursos econ&oacute;micos y el ejercicio de las facultades legislativa, reglamentaria, fiscalizadora y ejecutiva, por los &oacute;rganos del gobierno aut&oacute;nomo en el &aacute;mbito de su jurisdicci&oacute;n y competencias y atribuciones&rdquo;. </span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 95%; tab-stops: 531.6pt;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">&nbsp;</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 95%;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">Que, el art&iacute;culo 279 de la Constituci&oacute;n Pol&iacute;tica del Estado establece que &ldquo;El &Oacute;rgano Ejecutivo Departamental estar&aacute; dirigido por </span><span lang="ES-BO" style="font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',sans-serif;">la Gobernadora o el Gobernador, en condici&oacute;n de M&aacute;xima Autoridad Ejecutiva&rdquo;, precepto constitucional que ha sido desarrollado por el art&iacute;culo 30 Par&aacute;grafo II de la Ley N&ordm;031 de 19 de julio de 2010 Marco de Autonom&iacute;as y Descentralizaci&oacute;n &ldquo;Andr&eacute;s Ib&aacute;&ntilde;ez&rdquo;.</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 95%;"><span lang="ES-BO" style="font-size: 10.0pt; line-height: 95%; font-family: \'Arial\',sans-serif;">&nbsp;</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 95%;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',sans-serif;">Que, en el marco del r&eacute;gimen de autonom&iacute;as, el art&iacute;culo 32 Par&aacute;grafo II de la Ley N&deg;031 de 19 de julio de 2010 Marco de Autonom&iacute;as y Descentralizaci&oacute;n &ldquo;Andr&eacute;s Ib&aacute;&ntilde;ez&rdquo; se&ntilde;ala que &ldquo;Los &oacute;rganos ejecutivos de los gobiernos aut&oacute;nomos departamentales adoptar&aacute;n una estructura org&aacute;nica propia, de acuerdo a las necesidades de cada departamento, manteniendo una organizaci&oacute;n interna adecuada para el relacionamiento y coordinaci&oacute;n con la administraci&oacute;n del nivel central del Estado&rdquo;.</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 95%;"><span lang="ES-BO" style="font-size: 10.0pt; line-height: 95%; font-family: \'Arial\',sans-serif;">&nbsp;</span></p>
<p class="MsoNormalCxSpMiddle" style="margin-right: 45.1pt; mso-add-space: auto; text-align: justify; line-height: 95%;"><strong style="mso-bidi-font-weight: normal;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">CONSIDERANDO II:</span></strong></p>
<p class="MsoNormalCxSpMiddle" style="margin-right: 45.1pt; mso-add-space: auto; text-align: justify; line-height: 95%;"><strong style="mso-bidi-font-weight: normal;"><span lang="ES-BO" style="font-size: 10.0pt; line-height: 95%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">&nbsp;</span></strong></p>
<p class="MsoNormalCxSpMiddle" style="margin-top: 1.95pt; mso-add-space: auto; text-align: justify; line-height: 95%;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">Que, la Ley Departamental N&ordm; 99 de fecha 08 de mayo del 2020, de Organizaci&oacute;n B&aacute;sica del &Oacute;rgano Ejecutivo del Gobierno Aut&oacute;nomo Departamental del Beni, tiene por objeto aprobar la Estructura B&aacute;sica del &Oacute;rgano Ejecutivo del Gobierno Aut&oacute;nomo Departamental del Beni, atribuciones y funciones, as&iacute; como establecer la jerarqu&iacute;a normativa.</span></p>
<p class="MsoNormalCxSpMiddle" style="margin-top: 1.95pt; mso-add-space: auto; text-align: justify; line-height: 95%;"><span lang="ES-BO" style="font-size: 10.0pt; line-height: 95%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">&nbsp;</span></p>
<p class="MsoNormalCxSpMiddle" style="mso-add-space: auto; text-align: justify; line-height: 95%; margin: 1.95pt -.3pt .0001pt 0cm;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">Que, la Ley Departamental N&ordm; 124 de fecha 05 de octubre de 2023, &ldquo;&hellip;tiene por objeto modificar la Ley Departamental N&deg; 99 de 08 de mayo de 2020, con la finalidad de modificar la estructura org&aacute;nica b&aacute;sica del &Oacute;rgano Ejecutivo del Gobierno Aut&oacute;nomo Departamental del Beni&rdquo;.</span></p>
<p class="MsoNormalCxSpMiddle" style="margin-top: 1.95pt; mso-add-space: auto; text-align: justify; line-height: 95%;"><span lang="ES-BO" style="font-size: 10.0pt; line-height: 95%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">&nbsp;</span></p>
<p class="MsoNormalCxSpMiddle" style="margin-top: 1.95pt; mso-add-space: auto; text-align: justify; line-height: 95%;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',sans-serif;">Que, el art&iacute;culo 5 de la Ley Departamental N&deg; 99, establece que la Gobernadora o Gobernador es la M&aacute;xima Autoridad Ejecutiva del Departamento del Beni, conforme a la Constituci&oacute;n Pol&iacute;tica del Estado, y representa al Gobierno Aut&oacute;nomo Departamental del Beni ante instancias locales, departamentales, nacionales y extranjeras.</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 94%;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">Que, mediante su art&iacute;culo 6 Par&aacute;grafo III, la citada Ley Departamental se&ntilde;ala que &ldquo;Las Secretar&iacute;as Departamentales estar&aacute;n bajo la direcci&oacute;n de un Secretario/a Departamental, teniendo esta dependencia directo del Gobernador o Gobernadora del Departamento del Beni&rdquo;.</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 94%;"><span lang="ES-BO" style="font-size: 9.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">&nbsp;</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 94%;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">Que, el art&iacute;culo 12 de la Ley Departamental N&ordm; 99, regula la jerarqu&iacute;a al interior del &Oacute;rgano Ejecutivo Departamental del GAD Beni, establece en su numeral 2 que mediante Decreto de Gobernaci&oacute;n se designar&aacute; a secretarios y secretarias departamentales, mismos ser&aacute;n firmados por el Gobernador o Gobernadora del Departamento. </span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 94%;"><span lang="ES-BO" style="font-size: 9.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">&nbsp;</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 94%;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">Que, de acuerdo a la Ley Departamental N&ordm; 124 y Decreto Departamental N&ordm; 14/2024, <span style="background: yellow; mso-highlight: yellow;">la Secretar&iacute;a Departamental de Obras P&uacute;blicas y Servicios</span> forma parte de la estructura del &Oacute;rgano Ejecutivo Departamental del Beni.</span></p>
<p class="MsoNormalCxSpMiddle" style="margin-right: 7.95pt; mso-add-space: auto; text-align: justify; line-height: 94%;"><strong style="mso-bidi-font-weight: normal;"><span lang="ES-BO" style="font-size: 9.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">&nbsp;</span></strong></p>
<p class="MsoNormalCxSpMiddle" style="margin-right: 7.95pt; mso-add-space: auto; text-align: justify; line-height: 94%;"><strong style="mso-bidi-font-weight: normal;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">CONSIDERANDO III:</span></strong></p>
<p class="MsoNormalCxSpMiddle" style="margin-right: 7.95pt; mso-add-space: auto; text-align: justify; line-height: 94%;"><strong style="mso-bidi-font-weight: normal;"><span lang="ES-BO" style="font-size: 9.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">&nbsp;</span></strong></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 94%;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif;">Que, la Direcci&oacute;n de Recursos Humanos del Gobierno Aut&oacute;nomo Departamental del Beni, es la encargada de velar por el cumplimiento de los requisitos establecidos en la Constituci&oacute;n Pol&iacute;tica del Estado y normas vigentes para acceder a un cargo p&uacute;blico.</span></p>
<p class="MsoNormalCxSpMiddle" style="margin-right: -.3pt; mso-add-space: auto; text-align: justify; line-height: 94%;"><span lang="ES-BO" style="font-size: 9.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">&nbsp;</span></p>
<p class="MsoNormalCxSpMiddle" style="margin-right: -.3pt; mso-add-space: auto; text-align: justify; line-height: 94%;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">Que, el art&iacute;culo 28 de la Ley SAFCO establece que: &ldquo;Todo servidor p&uacute;blico responder&aacute; de los resultados emergentes del desempe&ntilde;o de las funciones, deberes y atribuciones asignados a su cargo&hellip;&rdquo;</span></p>
<p class="MsoNormalCxSpMiddle" style="margin-right: 7.95pt; mso-add-space: auto; text-align: justify; line-height: 94%;"><strong style="mso-bidi-font-weight: normal;"><span lang="ES-BO" style="font-size: 9.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">&nbsp;</span></strong></p>
<p class="MsoNormalCxSpMiddle" style="margin-right: -.3pt; mso-add-space: auto; text-align: justify; line-height: 94%;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">Que, en conformidad a lo establecido en el art&iacute;culo 12 del Reglamento Interno de Personal (RIP) aprobado mediante Resoluci&oacute;n de Gobernaci&oacute;n N&deg; 26/2011 de 28 de junio de 2011, corresponde al Gobernador del Departamento en su calidad de M&aacute;xima Autoridad Ejecutiva del Gobierno Aut&oacute;nomo Departamental del Beni, en uso de sus facultades ejecutivas, promover a las autoridades administrativas entre ciudadanos que cumplan lo que establece la Constituci&oacute;n Pol&iacute;tica del Estado en su Art. 232 y siguientes.</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 94%; tab-stops: 552.85pt;"><span lang="ES-BO" style="font-size: 9.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">&nbsp;</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 94%;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">Que, es atribuci&oacute;n del Gobernador del Departamento dictar normas ejecutivas para garantizar el ejercicio efectivo de sus atribuciones en el marco de la Constituci&oacute;n Pol&iacute;tica del Estado y dem&aacute;s disposiciones legales vigentes.</span></p>',
                'PorTanto' => '<p class="MsoNormalCxSpFirst" style="text-align: justify; line-height: 94%;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">El Gobernador del Departamento del Beni, en uso de sus leg&iacute;timas atribuciones conferidas por la Constituci&oacute;n Pol&iacute;tica del Estado, el art&iacute;culo 12 numeral 2 de la Ley Departamental N&ordm; 99, y dem&aacute;s disposiciones legales vigentes.</span></p>',
                'Decreta' => NULL,
            'Resuelve' => '<p class="MsoNormalCxSpFirst" style="text-align: justify; line-height: 94%;"><strong style="mso-bidi-font-weight: normal;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial; background: yellow; mso-highlight: yellow;">ART&Iacute;CULO PRIMERO. (PROMOCI&Oacute;N).- </span></strong><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial; background: yellow; mso-highlight: yellow; mso-bidi-font-weight: bold;">Promocionar </span><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial; background: yellow; mso-highlight: yellow;">al ciudadano <strong>REN&Eacute; ALEJANDRO MELGAR SU&Aacute;REZ </strong>con C&eacute;dula de Identidad N&ordm; 1729983 con QR, en el cargo de<strong style="mso-bidi-font-weight: normal;"> SECRETARIO DEPARTAMENTAL DE OBRAS P&Uacute;BLICAS Y SERVICIOS </strong>del Gobierno Aut&oacute;nomo Departamental del Beni.</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 94%;"><span lang="ES-BO" style="font-size: 9.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial; background: yellow; mso-highlight: yellow;">&nbsp;</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 94%;"><strong style="mso-bidi-font-weight: normal;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial; background: yellow; mso-highlight: yellow;">ART&Iacute;CULO SEGUNDO. (POSESI&Oacute;N).- </span></strong><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial; background: yellow; mso-highlight: yellow;">La autoridad promocionada tomar&aacute; posesi&oacute;n de su cargo con las debidas formalidades de rigor en acto especial.</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 94%;"><span lang="ES-BO" style="font-size: 9.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial; background: yellow; mso-highlight: yellow;">&nbsp;</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 94%;"><strong style="mso-bidi-font-weight: normal;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial; background: yellow; mso-highlight: yellow;">ART&Iacute;CULO TERCERO. (RESPONSABILIDAD).-<span style="mso-spacerun: yes;">&nbsp; </span></span></strong><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial; background: yellow; mso-highlight: yellow;">La autoridad promocionada responder&aacute; por sus acciones y/u omisiones emergentes del desempe&ntilde;o de las funciones, deberes y atribuciones asignadas a su cargo.</span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 94%;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial; background: yellow; mso-highlight: yellow;"><span style="mso-spacerun: yes;">&nbsp; </span></span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 94%;"><strong style="mso-bidi-font-weight: normal;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; background: yellow; mso-highlight: yellow;">ART&Iacute;CULO CUARTO. </span></strong><strong style="mso-bidi-font-weight: normal;"><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial; background: yellow; mso-highlight: yellow;">(ABROGATORIA Y DEROGATORIA).- </span></strong><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial; background: yellow; mso-highlight: yellow;">Se abrogan y derogan las disposiciones contrarias al presente Decreto de Gobernaci&oacute;n.</span><span lang="ES-BO" style="font-size: 11.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;"> </span></p>
<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: 94%;"><span lang="ES-BO" style="font-size: 9.0pt; line-height: 94%; font-family: \'Arial\',sans-serif; mso-fareast-font-family: Arial;">&nbsp;</span></p>
